import NextLink from 'next/link';


const Header = () => (
    <div>
        <NextLink href='/'>
            <a id='home-boton'>Home</a>
        </NextLink>
    <style jsx>{`
        div {
            margin-top: 20px;
        }
        #home-boton {
            font-size: 20px;
        }
    `}</style>
    </div>
)

export default Header;
